INSERT INTO `caipiao_news` VALUES (3,30,'网站介绍','关于我们','<p>\r\n	“彩票，是指国家为筹集社会公益资金，促进社会公益事业发展而特许发行、依法销售，自然人自愿购买，并按照特定规则获得中奖机会的凭证。”<br />\r\n目前特许发行的彩票有中国福利彩票和中国体育彩票，分别归口民政部和体育总局系统发行销售。<br />\r\n以中国福利彩票的拳头产品彩票为例，彩票销售收入的构成比例为：75%返还奖金，1%销售调节基金，5%发行费用，19%公益金。<br />\r\n其中公益金的用途对于福利彩票而言，主要投入到福利、慈善事业；对于彩票而言，主要投入到群众健身设施、奥运项目等等。<br />\r\n买彩票的目的\r\n</p>\r\n<p>\r\n	买彩票是支持中国公益事业的善举，买一注彩票2元钱不多，但表达的爱心无限。<br />\r\n客户买彩票目的，应该立足于爱心、娱乐、可承受。不应该为了侥幸中得大奖而铤而走险，动用不该动用的资金。<br />\r\n彩票团队\r\n</p>\r\n<p>\r\n	彩票目前拥有员工250余人，是一支充满朝气的年轻团队，正处于快速扩张时期。<br />\r\n我们的管理理念是为大家提供尽量宽松舒适的工作环境，充分尊重每个人的价值。管理虽然仍有不少欠缺，但是我们一直在努力做到阳光、健康、规范。<br />\r\n彩票网敞开人才引进之门，为有志之士提供足够的发展空间、提供优厚的薪酬福利待遇。<br />\r\n遵循共同分享的理念，以建设激情澎湃的共同创业团队为目的，我们准备了数量不菲的红股、期权奖励给所有为公司做出贡献的员工。\r\n</p>',1480805970),(10,34,'安全问题','参与游戏是否安全？','<p>\r\n	<span style=\"font-size:16px;\">快3网承若： </span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\">1、快3网采用128位SSL加密技术和严格的安全管理体系，确保客户安全得到最完善的保障。 </span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"> 2、客户的所有投注都是在极其严密的情况下进行，我们绝对不会向任何第三方透露客户资料。 </span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"> 3、我们会对每一项交易均采取严格的保密和防盗防诈措施，保证玩家帐户的真实合法性并同时保证玩家交易和支付的安全性。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"> 4、快3网安全性业内第一，还请放心游戏。</span>\r\n</p>',1480812017),(11,41,'优惠活动','单次充值赠送活动','单次充值赠送活动<strong></strong> 具体优惠返还金额联系客服咨询<br />',1480815430),(14,34,'安全问题','大富彩票简介','大富彩票是由中国福彩中心推出的全国唯一的大型垂直类彩票平台，涵盖国内所有的彩票玩法，致力于推动快3游戏在中国的发展。大富彩票目前是国内最受欢迎的快开类游戏，已经成功在国内覆盖了13个省份，有近千万彩民参与并购买过快3游戏，成功完成了几百亿的销售额。\r\n<p class=\"p2\">\r\n	大富彩票的推出是为了让彩民可以更简单、快捷的获取各个省份彩票的开奖数据，预测分析，提供专业的走势、遗漏数据，让彩民可以玩的更加专业，中得更多奖金。不仅如此，大富彩票还联合了几个省份，开通彩票在线投注。这极大的方便了彩民用户，实现可以随时随地的购买快3彩票。同时大富彩票还推出手机端，联合微信、支付宝，让彩民享受移动互联网的便利。\r\n</p>\r\n<p class=\"p3\">\r\n	大富彩票希望跟随中国福彩事业的发展，坚持以彩民利益为先，坚持提供安全、稳定、可靠的彩票数据，致力打造中国领先的彩票服务平台！\r\n</p>',1480965304),(15,34,'安全问题','注册之后信息是否会泄露？','<strong>在您注册成为我们的会员时，客户可能需要填写一些个人信息，如姓名、地址、电子邮箱、电话号码和银行帐号，以便我们更加及时方便的为您提供全方位的服务，在此我们相向您郑重承诺，我们会对会员的隐私进行保护，本平台在任何情况下都不会泄露客户资料！</strong>',1480965354),(16,34,'安全问题','安全中心的设置和介绍','<p>\r\n	本平台采用独有的手机和邮箱的双重认证体制，塑造全新的验证通道。\r\n</p>\r\n<p>\r\n	使其达到最安全的用户体验。\r\n        建议完备下列安全信息，使您账户的安全级别更高，资金更安全。\r\n</p>\r\n<p>\r\n	问题1、什么是手机和邮箱的实时验证码？\r\n</p>\r\n<p>\r\n	首次登陆要根据引导进行邮箱和手机的绑定操作，绑定后，以后的任何操作都要经过验证码的验证保护。\r\n</p>\r\n<p>\r\n	问题2、什么是安全问题？\r\n</p>\r\n<p>\r\n	安全问题用于找回您的平台账号资料，绑定后可以通过安全问题找回。\r\n</p>\r\n<p>\r\n	问题3、绑定邮箱的作用？\r\n</p>\r\n<p>\r\n	绑定邮箱可增加账号安全级别，也可以确保在邮箱正常的情况下取回实时验证码。\r\n</p>',1480965410),(17,35,'充值问题','网银汇款须知','<ul class=\"ul_help\" id=\"ul_help_s\">\r\n	<li style=\"background-color:#fff;\">\r\n		<div class=\"hc_cont\">\r\n			<strong><span style=\"color:#333333;font-family:\'Microsoft Yahei\', \'Hiragino Sans GB\', \'Helvetica Neue\', Helvetica, tahoma, arial, Verdana, sans-serif, \'WenQuanYi Micro Hei\', 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;\">由于网银汇款暂时只提供：工商银行和建设银行，没有这两个银行卡的会员，需要使用其他银行进行跨行转账；</span> \r\n			<p style=\"color:#666666;font-family:\'Microsoft Yahei\', \'Hiragino Sans GB\', \'Helvetica Neue\', Helvetica, tahoma, arial, Verdana, sans-serif, \'WenQuanYi Micro Hei\', 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n				为了您的充值能过及时到账，在使用跨行转账时，请尽量使用<strong>“加急汇款”</strong> \r\n			</p>\r\n			<p style=\"color:#666666;font-family:\'Microsoft Yahei\', \'Hiragino Sans GB\', \'Helvetica Neue\', Helvetica, tahoma, arial, Verdana, sans-serif, \'WenQuanYi Micro Hei\', 宋体;font-size:14px;background-color:#FFFFFF;\">\r\n				使用“加急汇款”功能的时间为周一至周五的09:00～16:30，其余时间和假日没有加急选项功能，建议您于可以在加急的时间段内进行充值，使用加急功能进行充值可以快速到账。\r\n			</p>\r\n</strong>\r\n		</div>\r\n	</li>\r\n</ul>',1480965470),(18,35,'充值问题','工行转账充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：获取充值信息，并请务必使用”复制”功能</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：点击“登录网上银行付款”，进入工行银行点击上方菜单栏位的“转账汇款”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang3.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步：点击页面左侧的“境内汇款”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang4.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第五步：使用“复制”功能，在网银对应栏内粘贴“收款人姓名、收款账号或者收款E-mail、附言”等必填信息（注：请复制申请充值信息的“附言”，粘贴入网银页面“给收款人附言”一栏)</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang5.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第六步：点击“提交”提示交易成功</strong> \r\n</p>',1480965488),(19,35,'充值问题','建行转账充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：获取充值信息</strong> \r\n</p>\r\n<p>\r\n	<strong><img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang2.png\" /></strong> \r\n</p>\r\n<p>\r\n	<strong>第三步：点击“转账汇款”,然后点击“活期转账汇款”,跳转跨行转账页面</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang3.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步：使用复制功能，在网银对应栏内粘贴“收款账户名、收款账号、附言”等必填信息。（注：复制正确的附言，张贴到附言一栏）</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang4.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第五步：跳转至确认转账信息页面后并点击“确认”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang5.jpg\" /> \r\n</p>\r\n<p>\r\n	<b>第六步：输入建行“网银盾密码”进行支付</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jianhang6.jpg\" /> \r\n</p>\r\n<p>\r\n	<b>第七步：支付信息确认后,跳转至“转账交易成功”页面 </b> \r\n</p>',1480965506),(20,35,'充值问题','农行转工商充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang1.png\" /> \r\n</p>\r\n<p>\r\n	<b>第二步：获取充值信息</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang2.png\" /> \r\n</p>\r\n<p>\r\n	<b>第三步：点击“登录网上银行汇款\'后，点击”单笔转账“</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/nonghang3.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步：添加”新增收款方“</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/nonghang4.png\" /> \r\n</p>\r\n<p>\r\n	<b>第五步：使用复制功能，在网银对应栏内粘贴“账号、账户名、开户网点”等信息</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/nonghang5.png\" /> \r\n</p>\r\n<p>\r\n	<b>第六步：复制平台“附言”信息，粘贴入“转账用途”</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/nonghang6.png\" /> \r\n</p>\r\n<p>\r\n	<b>第七步：输入\"支付密码“点击“提交” 第八步：支付信息确认后，跳转至“转账交易成功”页面</b> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/nonghang7.png\" /> \r\n</p>\r\n<b>第八步：支付信息确认后，跳转至“转账交易成功”页面</b>',1480965525),(21,35,'充值问题','民生转工商充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：获取充值信息</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：登录网银页面，点击“转账汇款”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/minsheng3.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步：选择“跨行转账”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/minsheng4.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第五步：使用复制功能，在网银对应栏内粘贴“收款账户名称、收款账户、附言”等信息（注：请复制申请充值信息的“附言”，粘贴入网银页面“用途”一栏)</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/minsheng5.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第六步：确认充值信息，点击“提交” </strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/minsheng6.jpg\" /> \r\n</p>\r\n<p>\r\n	<strong>第七步：交易成功页面</strong> \r\n</p>',1480965545),(22,35,'充值问题','招商转工商充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：获取充值信息</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：登录招商网银页面，点击“转账汇款”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/zhaohang3.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步:选择</strong><strong>“跨行转账”，	并使用复制功能，在网银对应栏内粘贴“收款方户名、收款方账号、开户网点”等信息（注：请复制申请充值信息的“附言”，粘贴入网银页面“附言”一栏) </strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/zhaohang4.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第五步：确认转账信息</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/zhaohang5.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第六步：充值成功信息</strong> \r\n</p>',1480965569),(23,35,'充值问题','交通转工商充值流程','<p>\r\n	<strong>第一步：点击首页“会员中心-资金管理-我要充值-网银汇款”按钮，选择“工商银行\"输入金额，点击“下一步”</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：获取充值信息</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/gongshang2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：登录网银，选择\"转账\"项下的\"转其他银行\"，点击\"汇款\"</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jiaotong3.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第四步：复制平台申请充值信息，粘贴入网银页面“收款人卡号、收款人户名、收款人开户银行、附言”等信息（注：请复制申请充值信息的“附言”，粘贴入网银页面“汇款附言”一栏)</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/jiaotong4.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第五步：核对信息后，输入“转入账户校验码”，点击“确定”，输入“usbkey密码”。</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/imag