ng>第二步：进入投注页面，选择自己喜欢的玩法（如 大小、单双），选择号码后输入”金额“</strong> <strong>点击”立即投注“</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/goucai2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：请再次检查是否正确，便可点击【确定】</strong> \r\n</p>\r\n<p>\r\n	<strong><img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/goucai3.png\" /></strong> \r\n</p>\r\n<p>\r\n	<strong>第四步： 投注成功后，点击【投注记录】即可查询投注记录</strong> \r\n</p>',1480965647),(27,37,'提现问题','平台提款安全吗？','<strong>通过提交提款申请确保只能由用户自己提款；通过将用户提交的提款银行卡信息与用户注册时提交的身份认证信息进行核对，确保用户只能提款到本人银行卡，任何人都无法盗取用户的资金，保证提款的绝对安全。</strong>',1480965672),(28,37,'提现问题','提现须知','<ul class=\"ul_help\" id=\"ul_help_s\">\r\n	<li style=\"background-color:#fff;\">\r\n		<div class=\"hc_cont\">\r\n			<ul class=\"ul_help\" id=\"ul_help_s\">\r\n				<li style=\"background-color:#FFFFFF;\">\r\n					<div class=\"hc_cont\">\r\n						<strong>1. 提款前请先绑定\"邮箱\"或\"手机\"，并且绑定好银行卡。&nbsp;</strong> \r\n						<p>\r\n							<strong>2. 提款金额必须在可提现额度范围以内。&nbsp;</strong> \r\n						</p>\r\n						<p>\r\n							<strong>3. 当发起提款申请成功后，提款10分钟内到账，如因网银系统问题或其他不可抗力因素影响，到账时间将会延迟，您有任何关于提款问题也可以咨询在线客服。</strong> \r\n						</p>\r\n					</div>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</li>\r\n</ul>',1480965692),(29,37,'提现问题',' 如何提款？','<p>\r\n	<strong>进入平台首页点击“会员中心--资金管理--我要取款”，选择您需要提款的银行卡后，输入您的\"验证码\"提交即可，首次注册账号的用户请您务必绑定好您的\"邮箱\"和\"或手机\"并且\"绑定银行卡\"。</strong> \r\n</p>\r\n<p>\r\n	<strong><img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/qk1.png\" /></strong> \r\n</p>',1480965710),(30,38,'账户安全','如何修改登录密码？','<ul class=\"ul_help\" id=\"ul_help_s\">\r\n	<li style=\"background-color:#fff;\">\r\n		<div class=\"hc_cont\">\r\n			<ul class=\"ul_help\" id=\"ul_help_s\">\r\n				<li style=\"background-color:#FFFFFF;\">\r\n					<div class=\"hc_cont\">\r\n						<strong>请您进入【平台安全中心--密码管理】，通过输入“旧密码”来修改您的登录密码。</strong> \r\n					</div>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</li>\r\n</ul>',1480965738),(31,38,'账户安全','忘记账户名怎么办？','<ul class=\"ul_help\" id=\"ul_help_s\">\r\n	<li style=\"background-color:#fff;\">\r\n		<div class=\"hc_cont\">\r\n			<ul class=\"ul_help\" id=\"ul_help_s\">\r\n				<li style=\"background-color:#FFFFFF;\">\r\n					<div class=\"hc_cont\">\r\n						<p>\r\n							<strong>忘记平台账户名（用户名</strong><strong>），请您联系平台客服提供相关资料帮助找回。</strong> \r\n						</p>\r\n					</div>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</li>\r\n</ul>',1480965763),(32,38,'账户安全','忘记登录密码怎么办？','<p>\r\n	&nbsp;<strong>第一步：进入平台登录页面，点击登录页面的“忘记密码”</strong> \r\n</p>\r\n<p>\r\n	&nbsp;<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/wjmm1.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第二步：第二步：输入您需要登录密码的账户名和验证码后点击“下一步” </strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/wjmm2.png\" /> \r\n</p>\r\n<p>\r\n	<strong>第三步：选择您需要找回登录密码的方式，共有以下3种方式可以找回。</strong> \r\n</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://www.k399.com/templates/SSC/images/bzzx/wjmm3.png\" /> \r\n</p>\r\n<p>\r\n	<strong>如果</strong><strong>以上方式都不可用？您还可以通过在线客服人工申诉找回登录密码</strong>。\r\n</p>',1480965940),(33,39,'玩法限制规则','玩法注数限制及最高奖金设置说明','<ul class=\"ul_help\" id=\"ul_help_s\">\r\n	<li style=\"background-color:#fff;\">\r\n		<div class=\"hc_cont\">\r\n			<ul class=\"ul_help\" id=\"ul_help_s\">\r\n				<li style=\"background-color:#FFFFFF;\">\r\n					<div class=\"hc_cont\">\r\n						<p>\r\n							<strong>本平台玩法限制，禁止一切刷佣金行为，对此平台将实时监控。</strong> \r\n						</p>\r\n						<p>\r\n							<strong>玩法限制：5星大于80000注，4星大于8000注，3星大于800注，2星大于80注，定位胆大于8码的一律按作弊处理，严重者给予封号处理。&nbsp;</strong> \r\n						</p>\r\n						<p>\r\n							<strong>每单最高奖金限额200000.00元，超出按200000.00元计算</strong><strong>超出的奖金清0；</strong> \r\n						</p>\r\n						<p>\r\n							<strong>五星直选1024注以内，四星直选81注、三星直选8注，二星直选4注以内，组三2注，组六4注及以下均列为单挑模式，单挑模式每期最高奖金10000.00元，超过将按10000.00元返还，请务必知悉</strong> \r\n						</p>\r\n					</div>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</li>\r\n</ul>',1480965965),(34,40,'快三技巧攻略','快3投注技巧与实战攻略分享：出球轨迹追踪法','新快3 独门秘籍分享 出球轨迹追踪法&nbsp;&nbsp; \r\n出球轨迹追踪法主要参考“快3原始装球顺序图”，快3中奖号码在装球顺序图中呈纵向、横向、三角形、斜向趣味分布。按该三要素走势，挑出“百位数号码摆\r\n放”“十位数号码摆放”“个位数号码摆放”中具有明显特征的号码，给予特别关注。<br />\r\n出球轨迹追踪法”以“球摆放”为立足点进行研究，角度新颖，不同于我们日常所参照的“试机号”与“机球号”等，较精确。球摆放即是指摇奖机中球的摆放位置，没有固定的顺序。<br />\r\n除“出球轨迹追踪法”外，本报特约彩评师李玉群的另一研究成果即“前三期有无号分布图”，即本期奖号在前三期中含有几个，三期有无号在分布图中呈有规\r\n律地分布。如果彩民能准确地断定当期号码在前三期会含有几个，那么投注范围将会缩小很多。该分布图被本报采纳后，在彩民中产生了较大反响，新彩民可细心留\r\n意。',1480965984),(35,40,'快三技巧攻略','快3投注技巧推荐：教您从公式中找选号玄机','在投注站里，有几个彩民扰着自己的头在想投注号码该选哪个，有的抬头看站里的走势图，有的人对着屏幕看开奖号，而这些人都是快3的爱好者，10分钟一期的快3游戏，让他们爱不释手。彩站的战主看到大家对选号头痛的样子，于是凑上前去告诉大家自己知道的一些小技巧。<br />\r\n&nbsp;<br />\r\n“快3”里，如果不分位置，同一个号码连续出现3或4期就是极限了，当某个号码连续出现4期(不分位置)，下期相信没人会再选它了。但是这种杀码的机会又不多，一年也没有几次连续出现4期的时候，于是大家就在寻找这种极限机会。“公式法”就是这样产生的，它一出现就受到了彩民的欢迎与追捧。<br />\r\n&nbsp;<br />\r\n公式一：<br />\r\n&nbsp;<br />\r\n“快3”中的“杀号公式”是这样的：当期开奖号码第3位×2+4，结果除以10取余数，余数即为“下期”很可能出的号码!<br />\r\n&nbsp;<br />\r\n公式二：<br />\r\n&nbsp;<br />\r\n当期开奖号码：第3位×3+3牞结果除以10取余数，余数即为“下期”很可能出的号码!',1480966010),(36,40,'快三技巧攻略','快3投注技巧与实战攻略分享：和值投注三原则','实践出真知，在彩民们运用了大量的方法来投注快3时，最后得出一个结论，运用和数值投注“快3”，是中奖率提高的重要手段之一。为了让中奖率进一步提高，总结出了准确选择排列三和数值的“三原则”：<br />\r\n原则一：相邻和数值是否开出。倘若我们选择13的和数值投注，就要先看一看与13相邻的和数值，即12和14的和数值是否曾开出。如果开出，就可考虑投注。如果12和14的和数值已经开出，下一期说不定就有可能出12和14的中间号，即13的和数值。否则，就应放弃。<br />\r\n原则三：同尾和数值是否开出。倘若我们选择13的和数值投注，就要看一看13的同尾和数值，即3或23的和数值是否开出。如果开出，就可考虑投注。在这 \r\n里，我们可以把已经开出的3或23的和数值视为和数值13的“前奏曲”，下一期，说不定就可能开出和数值13这个“协助曲”。否则，就应放弃。此“三原 \r\n则”，综合运用，才能收到明显效果，切忌不可单打独奏，拆开运用。<br />\r\n原则三：平均间隔期是否达到。以和数值13为例，从“快3”正式单 \r\n独开奖以来，截至到05018期，和数值13共出现过14次，其间隔的期数依次为：8、11、2、13、2、2、17、12、18、3、20、0、26、\r\n 1。间隔的总期数为135期，平均间隔期约为10期。我们在确定运用和数值投注时，就要看一看13的和数值是否已出现10期以上。倘若达到，就可考虑投\r\n 注;倘若没有达到，就应放弃。',1480966029),(37,40,'快三技巧攻略','快3技巧攻略详解：心态很重要 切勿忘三心','快3做为一种快开型彩票，即开即奖的特点让彩民们享受了不少购彩的乐趣，但无论中与不中，购买快3都需要不断调整心态，控制好购买的力度，这样无论结果如何，都是一次成功的购彩经历。那该怎样调整心态呢?小编觉得有“三心”很重要!<br />\r\n“玩”心：平常心对彩票的发行和长期购买应有一种健康心态。能冷静沉着地看待“风采”，情绪保持正常，无大波动。做到以买彩为游戏，不做冒险投赌，以“玩”为主，寻求乐趣，增加生活内容;投注多少量力而行，绝不影响生活。中彩与否在情绪上无大波动，中大奖不大喜，狂喜，防止乐极生悲;频投落空，不悔不怨，当做献“爱心”。<br />\r\n“恒”心：恒心购买彩票，期期紧跟，无特殊原因绝不间断，不学有些彩民兴来即投，失中即停，半途而废;也不因中小奖就加大注数，更不因频频失中便哀声叹气，以至中断买彩。要把买彩票看做锻炼毅力的好机会，持之以恒，细水长流，从长期玩彩中找乐趣，撞财运。<br />\r\n“学”心：选号要有“学”心，要学习别人投注的各种方法和技巧，在钻研过程中享受乐趣，丰富人生内涵，更重要的是总结个人投注的得失，从无规律中找窍门，寻求较好的投注方法。而老年彩民更要\"学\"，通过\"学\"玩彩促进脑细胞的新陈代谢，灵活脑力，达到延年益寿的目的。彩票世界，也是百态人生。',1480966047),(38,40,'快三技巧攻略','快3投注技巧：如何玩转三同号 高手为您来支招','三同号投注包含三同号通选和三同号单选两种玩法。其中三同号通选玩法相对比较简单，只用2元就可全包豹子(111、222、333、444、555、666)进行投注，开奖号码中，只要开出任意豹子即中奖;三同号单选投注，是指从所有相同的三个号码(111、222、333、444、555、666)中任意选择一组号码进行投注，该种玩法相对较难，但是相应的奖金也是比较较高。<br />\r\n下面总结出了高手彩民玩快3常用的几种技巧，希望对大家有所帮助。<br />\r\n一、遗漏追号<br />\r\n一个三同号的遗漏周期相对较大，目前最大遗漏是111组合的1260期，虽然三同号单选奖金较多，但风险大。因此，要根据时机来追三同号。可以根据最近的走势，假如前30期未开出，那么就可以通过56个号码分布图对比一下6个三同号在一个月内开出的次数，去掉最冷的和开的次数最多的，还有开的次数最少的三个三同号，剩下三个三同号做40期追号计划，根据自身条件设计合理的利润，在很多时候会有所收获。<br />\r\n如果你觉得选三同号太难，怕即使开出三同号也未必是你选择的那几个，那么选择追三同号通选就比较保险，只要在你追号的周期内开出，你就可以盈利。当然小编也要提醒大家，在最近连续开出21天三同号的情况下追三同号通选也是存在风险的，因为一个号热久了会有冷的一天。您也可以选择在三同号冷后的第三天开始利用这个方法来设计追三同号单选或者三同号通选，以此来提高命中率。<br />\r\n二、利用和值选号<br />\r\n在快3中，包含三同号组合的和值分别有：3(111)、6(222)、9(333)12(444)、15(555)、18(666)，其中9和12的出现频率较高，而3和18的奖金最高，但开出概率较低。因此，可以重点关注几个高频率的中间和值来进行选号，投注三同号单选。<br />\r\n三、重号热号结合<br />\r\n观察最近10期的开奖号码，可利用热号和重号结合来选号投注三同号单选。从图中可以看出，热号1在连续开出了3期后，第72期便开出了三同号111。<br />\r\n三同号通选的理论遗漏为1/36，在三同号通选的遗漏期数达到理论遗漏的2倍左右，就可以结合近两天三同号的出号情况做一个追号计划。值得注意的是，三同号通选的历史最大遗漏为317期。',1480966068),(39,41,'优惠活动','每日消费赠送活动','每日消费赠送活动',1480966323),(40,41,'优惠活动','每月消费赠送活动','每月消费赠送活动',1480966339),(41,41,'优惠活动','每日亏损赠送活动','每日亏损赠送活动',1480966355),(42,41,'优惠活动','每月亏损赠送活动','每月亏损赠送活动',1480966370),(43,33,'帮助指南','如何注册','<p style=\"font-size:14px;color:#666666;background-color:#FFFFFF;font-family:&quot;\">\r\n	<span style=\"font-size:12px;\">点击网站右上角＂用户注册＂按钮，就可以进入用户注册页面；</span>\r\n</p>\r\n<p style=\"font-size:14px;color:#666666;background-color:#FFFFFF;font-family:&quot;\">\r\n	按照提示，填写注册信息，即可完成<span style=\"font-size:12px;\">注册</span>；\r\n</p>\r\n<p style=\"font-size:14px;color:#666666;background-color:#FFFFFF;font-family:&quot;\">\r\n	账号为4-15位字符，支持数字和字母，禁止以0开头；\r\n</p>\r\n<p style=\"font-size:14px;color:#666666;background-color:#FFFFFF;font-family:&quot;\">\r\n	密码为6-16位字符，支持数字、字母、符号；\r\n</p>\r\n<p style=\"font-size:14px;color:#666666;background-color:#FFFFFF;font-family:&quot;\">\r\n	注册完成后，系统将随机分配一张头像，进入＂我的账户＂＂个人信息＂可以修改头像和设置昵称；\r\n</p>',1494640149),(44,33,'帮助指南','在线客服服务时间','<span style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\"><span style=\"font-weight:bolder;font-family:&quot;font-size:12px;\">平台在线客服在上午</span></span><span style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\"><span style=\"font-weight:bolder;font-family:&quot;font-size:12px;\">08:30-夜间24:00为您提供最优质专业的服务，</span></span><span style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\"><span style=\"font-weight:bolder;font-family:&quot;font-size:12px;\">其他时间段请您留下您的联系方式，问题，我们会尽快帮您联系处理</span></span><span style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\"><span style=\"font-weight:bolder;font-family:&quot;font-size:12px;\">。平台的服务宗旨：我专业，您放心，我敬业，您省心。</span></span>',1494640774),(45,33,'帮助指南','平台的充值方式有哪些？','<p style=\"font-family:微软雅黑, &quot;font-size:14px;background-color:#FFFFFF;color:#666666;\">\r\n	<span style=\"font-family:Tahoma;\">本站暂时提供四种充值方式，即“网银汇款、快捷充值、微信充值和支付宝充值”。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑, &quot;font-size:14px;background-color:#FFFFFF;color:#666666;\">\r\n	<span style=\"font-family:Tahoma;\">网银汇款：指通过网上银行、银行存款等方式打款到本站提供的银行账户；</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑, &quot;font-size:14px;background-color:#FFFFFF;color:#666666;\">\r\n	<span style=\"font-family:Tahoma;\">快捷充值：指通过第三方进行支付，方便快捷；</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑, &quot;font-size:14px;background-color:#FFFFFF;color:#666666;\">\r\n	<span style=\"font-family:Tahoma;\">支付宝充值：指通过支付宝转账到本站提供的支付宝账户。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑, &quot;font-size:14px;background-color:#FFFFFF;color:#666666;\">\r\n	<span style=\"font-family:Tahoma;\">微信充值：指通过微信转账到本站提供的微信账户。</span>\r\n</p>',1494640796),(46,33,'帮助指南','如何购彩','<p style=\"font-family:&quot;font-size:14px;color:#666666;background-c