指定的不同号码和一个任意号码进行投注。<br />\r\n（六）三连号通选投注（即全包）：是指对所有三个相连的号码（仅限：123、234、345、456）进行投注。</span> \r\n</h3>\r\n<h3 style=\"font-family:微软雅黑;font-size:12px;color:#333333;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:bolder;font-family:;\"><span style=\"font-size:14px;color:#000000;\"></span></span> \r\n</h3>\r\n<h1 style=\"font-size:12px;font-family:微软雅黑;color:#333333;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:bolder;font-family:;\"><span style=\"font-size:14px;color:#E53333;\">以上如不清楚请您与客服联系！谢谢合作！</span></span> \r\n</h1>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>',1494641056),(54,33,'帮助指南','什么是可提现金额','<p style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">为防止洗黑钱等行为；每一笔充值，至少需要投注充值金额的50%才可以全额提现；</span>\r\n</p>\r\n<p style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:bolder;font-size:12px;\"><span style=\"color:#333333;\">可提现金额计算方式如下：</span></span>\r\n</p>\r\n<ul style=\"font-family:&quot;color:#666666;background-color:#FFFFFF;\">\r\n	<li>\r\n		<span>可提现金额 = 有效投注金额×2（此项需要投注金额达到充值金额的30%才计入）+ 所有奖金派送 + 活动所得礼金；</span>\r\n	</li>\r\n</ul>\r\n<p style=\"font-family:&quot;font-size:14px;color:#666666;background-color:#FFFFFF;\">\r\n	有效投注金额指所有有效投注的金额，撤单的投注金额将不计算在内；\r\n</p>\r\n<div>\r\n	<br />\r\n</div>',1494641072),(55,33,'帮助指南','二维码支付管理','<p style=\"font-family:;\" font-size:14px;color:#666666;background-color:#ffffff;text-align:center;\"=\"\"> <span style=\"color:#E53333;font-size:12px;\"><span style=\"font-weight:bolder;\">手机用户：请扫图二维码，</span></span> \r\n	</p>\r\n<p style=\"font-family:;\" font-size:14px;color:#666666;background-color:#ffffff;text-align:center;\"=\"\"><span style=\"color:#E53333;font-size:12px;\"><span style=\"font-weight:bolder;\">然后再退出页面，打开您的手机支付宝钱包，点击扫一扫，从相册提取刚才保存的这张二维码扫码，点击转账之前提交订单的金额。进行转账！转账成功后自动入款。如有遇到没到账